import React, {useState, useRef, useEffect} from 'react';
import '@toast-ui/editor/dist/toastui-editor.css';
import { Editor, Viewer } from '@toast-ui/react-editor';
import  "@/pages/markdown/index.less";
import {Button, Input, message, Select} from 'antd';
import {Avatar} from '@douyinfe/semi-ui';
import {FormOutlined,EyeOutlined} from '@ant-design/icons';
import { Link } from 'umi';

import Prism from 'prismjs';
import codeSyntaxHighlightPlugin from '@toast-ui/editor-plugin-code-syntax-highlight';
import tableMergedCellPlugin from '@toast-ui/editor-plugin-table-merged-cell';
import chartPlugin from '@toast-ui/editor-plugin-chart';
import umlPlugin from '@toast-ui/editor-plugin-uml';
import colorPlugin from '@toast-ui/editor-plugin-color-syntax';
import 'prismjs/themes/prism.css';
import '@toast-ui/editor-plugin-code-syntax-highlight/dist/toastui-editor-plugin-code-syntax-highlight.css';
import '@toast-ui/editor-plugin-table-merged-cell/dist/toastui-editor-plugin-table-merged-cell.css';
import 'tui-color-picker/dist/tui-color-picker.css';
import '@toast-ui/editor-plugin-color-syntax/dist/toastui-editor-plugin-color-syntax.css';

import {UploadImage} from "@/services/tools/upload";
import {initData} from "@/pages/markdown/data";

import {CommitArticle, GetArticleDetail} from "@/services/articles/article";
import { history } from 'umi';

export default function App() {
    const [image, setImage] = useState("");
    const [content, setContent] = useState('')
    const [category, setCategory] = useState("arch")
    const [topic, setTopic] = useState("")
    const [url, setUrl] = useState("")
    const [title, setTitle] = useState("")
    const [token, setToken] = useState("")

    const [loading, setLoading] = useState(true);
    const [messageApi, contextHolder] = message.useMessage();
    const editor_ref = useRef<Editor>(null);

    const [article, setArticle] = useState<API.Article>({});


    const searchParams = new URLSearchParams(window.location.search);
    const debug = searchParams.get('debug')
    const queryID = searchParams.get('id');
    const id = queryID ? parseInt(queryID): 1
    console.log("参数", id)

    console.log("debug", debug)
    if (debug == null || debug.length == 0) {

        // 跳转到指定路由
        history.push('/');
    }

    useEffect(() => {
        document.title = '文章发布';
        const params:API.ArticleDetailParams = {id:id};
        GetArticleDetail(params).then((res) => {
            setArticle(res.data)
            setLoading(false)

            setContent(res.data.content ? res.data.content: "")
            setCategory(res.data.category ? res.data.category: "")
            setTitle(res.data.title ? res.data.title: "")
            setTopic(res.data.topics ? res.data.topics: "")
            setUrl(res.data.url_token ? res.data.url_token: "")

            console.log("请求返回值", article.content)
        });
    }, []);


    const height = (window.innerHeight - 83).toString() + "px"
    console.log("高度", height)


    const handleTokenChange = (value:any) => {
        setToken(value.target.value)
        console.log("token", token)
    }
    const handleCategoryChange = (value:any) => {
        setCategory(value)
        console.log("标签", category)
    }
    const handleTopicChange = (value:any) => {
        setTopic(value.target.value)
        console.log("话题", topic)
    }
    const handleURLChange = (value:any) => {
        setUrl(value.target.value)
        console.log("URL", topic)
    }
    const handleTitleChange = (value:any) => {
        setTitle(value.target.value)
        console.log("标题", title)
    }
    const handleChange = () => {
        const editor_instance = editor_ref.current?.getInstance()
        setContent(editor_instance?.getMarkdown())
        console.log("内容MD", content)
    }

    const doCommit = () => {
        if (content == "") {
            return messageApi.open({type: 'warning', content: "文章内容不能为空"})
        }
        if (category == "") {
            return messageApi.open({type: 'warning', content: "标签不能为空"})
        }
        if (topic == "") {
            return messageApi.open({type: 'warning', content: "话题不能为空"})
        }
        if (url == "") {
            return messageApi.open({type: 'warning', content: "短地址不能为空"})
        }
        if (title == "") {
            return messageApi.open({type: 'warning', content: "标题不能为空"})
        }

        const params = {
            "id": id,
            "token": token,
            "content": content,
            "category": category,
            "topics": topic,
            "url_token": url,
            "title": title,
        }

        console.log("params", params)

        // TODO 发布请求，数据提交接口
        CommitArticle(params).then((res) => {
            console.log("请求返回值", res)
            if (res.code == 0) {
                messageApi.open({
                    type: 'success',
                    content: "内容发布成功",
                })
            }  else {
                messageApi.open({
                    type: 'warning',
                    content: "内容发布失败",
                })
            }

        }).catch(function(error) {
            console.log(error);
            messageApi.open({
                type: 'warning',
                content: "内容发布失败",
            })
        });
    }

    const style = {
        backgroundColor: 'var(--semi-color-overlay-bg)',
        height: '100%',
        width: '100%',
        display: 'flex',
        alignItems: 'center',
        justifyContent: 'center',
    };
    const hover = (
        <div ><img style={style} src="data:image/jpeg;base64,"/></div>
    );
    const colorSyntaxOptions = {
        preset: ['#181818', '#292929', '#393939']
    };
    const chartOptions = {
        minWidth: 100,
        maxWidth: 600,
        minHeight: 100,
        maxHeight: 300,
    };
    return (
        <div className="App" >
            {contextHolder}
            <div style={{marginLeft:20, marginTop:20, marginBottom:20}}>
                <Link to="/"><Avatar style={{ width:45, height:45, color: '#f56a00', backgroundColor: '#fde3cf', marginTop: -5 }} size="medium" hoverMask={hover} alt='栗的博客'>栗</Avatar></Link>&nbsp;&nbsp;
                <span style={{ "color": "#333"}}>若能虚己以游世，其孰能害之。</span>&nbsp;&nbsp;&nbsp;&nbsp;
                <span style={{color: "#333", fontWeight: 400, fontSize:14}}>标签：</span>
                <Select
                    defaultValue="架构"
                    style={{"width": 100}}
                    onChange={handleCategoryChange}
                    options={[
                        { value: 'arch', label: '架构' },
                        { value: 'insight', label: '思考' },
                    ]}
                />&nbsp;&nbsp;&nbsp;&nbsp;
                <span style={{color: "#333", fontWeight: 400, fontSize:14}}>话题：</span>{!loading && <Input style={{"width": 100}} placeholder=""  defaultValue={article.topics} onChange={handleTopicChange} />}&nbsp;&nbsp;&nbsp;&nbsp;
                <span style={{color: "#333", fontWeight: 400, fontSize:14}}>URL：</span>{!loading && <Input style={{"width": 100}} placeholder="" defaultValue={article.url_token} onChange={handleURLChange} />}&nbsp;&nbsp;&nbsp;&nbsp;
                <span style={{color: "#333", fontWeight: 400, fontSize:14}}>密码：</span>{!loading && <Input style={{"width": 100}} placeholder=""  onChange={handleTokenChange} />}&nbsp;&nbsp;&nbsp;&nbsp;
                <span style={{color: "#333", fontWeight: 400, fontSize:14}}>标题：</span>{!loading && <Input style={{"width":300}} placeholder="" defaultValue={article.title} onChange={handleTitleChange} />}&nbsp;&nbsp;&nbsp;&nbsp;
                <Link target="_blank" to="/detail" ><Button icon={<EyeOutlined />}>预览</Button></Link>&nbsp;&nbsp;&nbsp;&nbsp;
                <Button icon={<FormOutlined />} style={{ height:32, display:"inline", marginLeft:0, marginTop:0, marginBottom:0}} onClick={doCommit}>发布</Button>
            </div>
            <div>
                {!loading &&   <Editor
                    ref={editor_ref}
                    initialValue={article.content}
                    initialEditType="markdown"
                    previewStyle="vertical"
                    height={height}
                    plugins={[
                        [codeSyntaxHighlightPlugin, { highlighter: Prism }],
                        [chartPlugin, chartOptions],
                        tableMergedCellPlugin,
                        umlPlugin,
                        [colorPlugin, colorSyntaxOptions],
                    ]}
                    toolbarItems={[['heading', 'bold', 'italic', 'strike'], ['hr', 'quote'], ['ul', 'ol', 'task', 'indent', 'outdent'], ['table', 'image', 'link'], ['code', 'codeblock']]}
                    onChange={handleChange}
                    usageStatistics={false}
                    placeholder="写下你的想法.."
                    hooks={{
                        addImageBlobHook: (fileOrBlob: Blob | File, callback: (url: string, text?: string) => void) => {
                            const param = new FormData();
                            param.append('file', fileOrBlob);
                            console.log("param", param)

                            // 图片上传请求
                            UploadImage(param)
                                .then((res) => {
                                    setImage(res.data?.url ? res.data.url :  "");
                                    setLoading(false)
                                    console.log("请求返回值", loading, image)
                                })
                                .catch((err) => {
                                    console.log("错误", err);
                                });

                            /* request({
                                 url: '/api/v1.0/tools/upload-image',
                                 headers: { 'Content-Type': 'multipart/form-data' },
                                 method: 'POST',
                                 data: param,
                             })
                             .then((res) => {
                                 const { data } = res as any;
                                 const { url, name } = data || {};
                                 callback(url, name);
                             })
                             .catch((err) => {
                                 console.log(err);
                             });*/
                        },
                    }}
                />}
            </div>
        </div>
    );
}
